"mike.walker@talgov.com"], "centrality": 0.0, "stage": 0, "centrality_name": "degree"}, {"name": ["michael", "wright", "michael.wright2@talgov.com"], "centrality": 0.00013134391089629087, "stage": 0, "centrality_name": "degree"}, {"name": ["michael.deleo@talgov.com\"bob gabordi", " ", "michael.deleo@talgov.com\"bob gabordi_ "], "centrality": 0.0, "stage": 0, "centrality_name": "degree"}, {"name": ["michael.parker@talgov.com parker", " ", "michael.parker@talgov.com parker_ "], "centrality": 2.626878217925817e-05, "stage": 0, "centrality_name": "degree"}, {"name": ["michele", "mcgee", "michele.mcgee@talgov.com"], "centrality": 0.00010507512871703268, "stage": 0, "centrality_name": "degree"}, {"name": ["michelle", "bono", "michelle.bono@talgov.com"], "centrality": 0.005201218871493118, "stage": 0, "centrality_name": "degree"}, {"name": ["michelle", "davis", "michelle.davis@talgov.com"], "centrality": 0.001050751287170327, "stage": 0, "centrality_name": "degree"}, {"name": ["michelle", "hill", "michelle.hill@talgov.com"], "centrality": 0.00021015025743406537, "stage": 0, "centrality_name": "degree"}, {"name": ["michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http:// gov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved y 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference a ee"}, {"name": ["michael", "chbat", "michael.chbat@talgov.com"], "centrality": 0.0, "stage": 1, "centrality_name": "degree"}, {"name": ["michael", "deleo", "michael.deleo@talgov.com"], "centrality": 0.00015761269307554903, "stage": 1, "centrality_name": "degree"}, {"name": ["michael", "german", "mgerman@wtxl.tv"], "centrality": 0.0, "stage": 1, "centrality_name": "degree"}, {"name": ["michael", "parker", "michael.parker@talgov.com"], "centrality": 0.0004465692970473889, "stage": 1, "centrality_name": "degree"}, {"name": ["michael", "walker", "mike.walker@talgov.com"], "centrality": 2.626878217925817e-05, "stage": 1, "centrality_name": "degree"}, {"name": ["michael", "wright", "michael.wright2@talgov.com"], "centrality": 0.0, "stage": 1, "centrality_name": "degree"}, {"name": ["michael.deleo@talgov.com\"bob gabordi", " ", "michael.deleo@talgov.com\"bob gabordi_ "], "centrality": 2.626878217925817e-05, "stage": 1, "centrality_name": "degree"}, {"name": ["michael.parker@talgov.com parker", " ", "michael.parker@talgov.com parker_ "], "centrality": 0.0, "stage": 1, "centrality_name": "degree"}, {"name": ["michele", "mcgee", "michele.mcgee@talgov.com"], "centrality": 7.880634653777451e-05, "stage": 1, "centrality_name": "degree"}, {"name": ["michelle", "bono", "michelle.bono@talgov.com"], "centrality": 0.0008931385940947778, "stage": 1, "centrality_name": "degree"}, {"name": ["michelle", "davis", "michelle.davis@talgov.com"], "centrality": 2.626878217925817e-05, "stage": 1, "centrality_name": "degree"}, {"name": ["michelle", "hill", "michelle.hill@talgov.com"], "centrality": 0.00042030051486813074, "stage": 1, "centrality_name": "degree"}, {"name": ["michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city o mpetition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchma ondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, e": ["michele", "mcgee", "michele.mcgee@talgov.com"], "centrality": 2.626878217925817e-05, "stage": 2, "centrality_name": "degree"}, {"name": ["michelle", "bono", "michelle.bono@talgov.com"], "centrality": 0.0014710518020384575, "stage": 2, "centrality_name": "degree"}, {"name": ["michelle", "davis", "michelle.davis@talgov.com"], "centrality": 0.0, "stage": 2, "centrality_name": "degree"}, {"name": ["michelle", "hill", "michelle.hill@talgov.com"], "centrality": 0.0006567195544814543, "stage": 2, "centrality_name": "degree"}, {"name": ["michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham owcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership an ts support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellenc trality": 7.880634653777451e-05, "stage": 3, "centrality_name": "degree"}, {"name": ["michelle", "hill", "michelle.hill@talgov.com"], "centrality": 0.0007092571188399707, "stage": 3, "centrality_name": "degree"}, {"name": ["michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my co ichelle", "davis", "michelle.davis@talgov.com"], "centrality": 0.0, "stage": 3, "centrality_name": "betweenness_centrality"}, {"name": ["michelle", "hill", "michelle.hill@talgov.com"], "centrality": 5.266574885595002e-06, "stage": 3, "centrality_name": "betweenness_centrality"}, {"name": ["michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talg ohn pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the members of this exceptional city of tallahassee team and have discussed their  commitment, approach, and focus on performance excellence in this endeavor. they are role models for our community and our state as a whole. in addition, as a personal advocate and leader for our sterling/baldrige performance excellence framework over a 25 year period, in florida, and now globally, may i offer the hope that this team showcase recognition sets the foundation for an \"onward and upward\" trajectory, where \"our\" city becomes a full sterling award candidate in the near future, to cover all departments and all areas of your operation. such a full scope sterling commitment aligns most directly with our community-wide discussions on *\"imagine tallahassee.\"* exactly that truly imagine the city of tallahassee as a sterling and/or baldrige winner by 2016 or earlier. let\\'s go for it! finally, i am sorry to say i will be out of the office next wednesday, june 19, 2013, when these team showcase employees will be recognized again publicly by our city commission. i trust this commission meeting will be will a wonderful opportunity to learn more about this team\\'s accomplishments and continuing progress. you are welcome to include my brief remarks as expressed here in the public record, as just one example of one citizen showing appreciation for an exceptional job well done by these city of tallahassee public servants. have a wonderful summer and i will hope to see you at future community events as we continue sharing ideas on performance excellence. thanks sincerely, dale f. weeks, president global leadership and benchmarking associates 3041 shamrock north tallahassee, fl usa 32309 e-mail: dfwglba@gmail.com phone: 850-591-1076 https://sites.google.com/site/dfglba/ member: global benchmarking network http://www.globalbenchmarking.org/ http://www.tallahassee.com/apps/pbcs.dll/article?aid=2013130607018 city\\'s underground utilities wins florida sterling council top honor tallahassee democrat, june 7, 2013  written by dave hodges <dhodges@tallahassee.com> the business blog - filed under - business <http://www.tallahassee.com/section/business> - business matters", " ", "michelle bono <michelle.bono@talgov.com>, dee crumpler july 24 2012 < willis.crumpler@talgov.com>, \"raoul.lavin@talgov.com\" < raoul.lavin@talgov.com>, \"rick.minor@talgov.com\" <rick.minor@talgov.com>, joe.cheatham@talgov.com, sondra.lee@talgov.com, dione geiger < dgeiger@floridasterling.com>, john pieno <jpieno@floridasterling.com>, jay townsend <jay.townsend@talgov.com>, nico.lauw@talgov.com, mike.tadros@talgov.com, barbara.hinson@talgov.com, heath.beach@talgov.com hi again, madam city manager: i wanted to simply offer my congratulations to you and your city of tallahassee senior leadership for its support of your underground utilities unit in its sterling team showcase competition and their recent award recognition. i was fortunate again this year to be a part of our 21st annual sterling conference and i strongly endorse the decisions of the judges involved. i was there in orlando on friday, may 31,2012 as they received their award an enlightening event for sure. and, very briefly, over the last few months, i have met most of the membe
